import React, { Component } from "react";

class FamilyNav extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div id="familyNavWrapper"></div>
        <div style={{ marginLeft: 200 }}>Stuff</div>
      </React.Fragment>
    );
  }
}

export default FamilyNav;
